        table_schema: name
        table_name: name
        table_type: varchar
        self_referencing_column_name: name
        reference_generation: varchar
        user_defined_type_catalog: name
        user_defined_type_schema: name
        user_defined_type_name: name
        is_insertable_into: varchar
